const request = require('supertest')
let URL = 'http://20.225.209.57:3092/perfil/';

//http://20.225.209.57:3092/perfil/get_info_perfil/?user=${idUsr}&rol=${rolUsr}
describe('GET / Informacion de perfil', () => {

    beforeAll(() => {
        URL += "get_info_perfil"
    });

    afterAll(() => {
        URL = 'http://20.225.209.57:3092/perfil/'
    });

    //Deberia ser 200?
    test('GET sin parametros', async () => {
        await request(URL)
            .get('/')
            .expect(200);
    });

    //Deberia regresar semestre 1?
    test('GET informacion con solo el usuario', async () => {
        await request(URL)
            .get('/?user=A01734609')
            .expect(200);
    });

    //Regresa datos nullos
    test('GET informacion con solo el rol', async () => {
        await request(URL)
            .get('/?rol=asesorado')
            .expect(200);
    });

    //Deberia regresar semestre 1?
    test('GET informacion de A01734609', async () => {
        const response = await request(URL)
            .get('/?user=A01734609&rol=asesorado')
            console.log(response.body)
            expect(response.statusCode).toBe(200);
    });

});

